import React, {Fragment} from 'react';
import {Link} from 'react-router-dom';
const pratikphoto = require('./PratikNallamotu.jpg');

const AboutPratik = () => {
    return (
        <Fragment>
            <section className='aboutpratik'>
            <div className="landing-inner">
            <h1 className='x-large'>PRATIK NALLAMOTU</h1>
            <h3>Student | Programmer</h3>
            </div>
        </section>
        <div id = "aboutme">
            <div class="container">
                <div class ="row">
                    <div class="col-sm-4">
                        <h2>About Me</h2>
                        <img src={pratikphoto} />
                    </div>
                    <div class="col-sm-8">
                        <p>I am currently a third year Computer Science Major at Georgia Tech with concentrations in Intelligence and People. I chose to major in Computer Science because Computer Science is one big puzzle to me. Depending on the pieces used you can result in a different final result each time. Most of my experience comes from front-end development from the last two summers. 
                        </p>
                    </div>
                </div>
            </div>
        </div>
        </Fragment>

    );
}

export default AboutPratik;
